[DAY 28! GIVE IT UP FOR DAY 28!](https://www.reddit.com/r/nonutnovember/comments/z6nbg0/day_28_give_it_up_for_day_28/)

&#x200B;

STILL IN!

Day 28, Still In.

&#x200B;

So I have a prescription for anxiety medication. It helps "balance me out" in a way. Now, I haven't been taking them for the past few months, and I've been *ok.* I've just been more aggressive lately, and I'm not sure how to feel about it. On one hand, the medication helps with feelings of aggression, social anxiety, ect. But on the other hand, I *really* don't like what they symbolize. They are a reminder that I am broken, that I need fixing, and that it is clear to others that something about me is wrong. I tell myself that if I can function without them, then I'm fine, completely normal. I'll just need to think about it some more. I wasn't ever really good with taking them consistently. See you tomorrow.

Still IN

&#x200B;

Why is this week so sloooow...
